// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.11;

contract lottery {
    // variables
    address public owner;
    address payable[] public playerEntries;

    //constructor
    constructor() {
        owner = msg.sender;
    }

    // functions
    function enter(uint amount) public payable {
        require(msg.value >= amount * 1 ether, "Each entry costs 1 Ether.");
        for (uint i = 0; i >= amount; i++) {
            playerEntries.push(payable(msg.sender));
        }
    }
}

